import React, { Component } from 'react'
import api from '../api'
import axios from 'axios'


class ListaConsulta extends Component {
    constructor(props) {
        super(props)
        this.state = {
            enquiries: [],
            columns: [],
            isLoading: false,
        }
    }

    componentDidMount = async () => {
        this.setState({ isLoading: true })

        await axios.get('http://localhost:5000/enquiries').then(enquiries => {
            this.setState({
                enquiries: enquiries.data.data,
                isLoading: false,
            })
        })
    }

    render() {
        const { enquiries, isLoading } = this.state

        return (
           <p>{enquiries.motivo}</p>
        )
    }
}

export default ListaConsulta
